  CREATE OR REPLACE TRIGGER "JVM10"."TRG_ACT_CORR_BUS_EVE" 
after insert on bus_evento
referencing old as old new as new
for each row
declare
v_correlativo number;
begin
  
  begin
    select correlativo_disponible
    into v_correlativo
    from correlativo
    where id_correlativo = 9
    and estado_registro = 'A';
  exception
    when no_data_found then
      raise_application_error(-200001,'No existe Correlativo');
    when others then
      raise_application_error(-200001,'Error Inesperado - '||SQLCODE||' -ERROR- '||SQLERRM);
  end;
  
    update correlativo
    set correlativo_disponible = v_correlativo + 1
    where id_correlativo = 9
    and estado_registro = 'A';

end; 
/
