--  DDL for Trigger TRG_AGREGAR_OPC_INS
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "JVM10"."TRG_AGREGAR_OPC_INS" 
after insert on inscripcion
referencing old as old new as new
for each row
begin

    select :new.id_participante, oe.id_evento, oe.id_opcion,'B',upper(:new.usuario_creacion),sysdate
    from opcion_evento oe, evento ev 
    where oe.id_evento = ev.id_evento
    and oe.obligatorio = 'N'
    and oe.id_evento = :new.id_evento;
    
    
    select :new.id_participante, oe.id_evento, oe.id_opcion,'A',upper(:new.usuario_creacion),sysdate
    from opcion_evento oe, evento ev 
    where oe.id_evento = ev.id_evento
    and oe.obligatorio = 'S'
    and oe.id_evento = :new.id_evento;
    
exception 
when others then
raise_application_error(-20000, 'No fue posible insertar en la tabla inscripcion_opcion '||sqlerrm);
end; 
/
ALTER TRIGGER "JVM10"."TRG_AGREGAR_OPC_INS" ENABLE;
