--  DDL for Trigger TRG_DELETE_BUSINSCRIPCION
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "JVM10"."TRG_DELETE_BUSINSCRIPCION" 
before delete on bus_inscripcion
for each row
declare

v_disponible_old number :=0;
v_ocupado_old number:=0;

begin

    select disponible, ocupado
    into v_disponible_old,v_ocupado_old
    from bus_evento
    where id_evento = :old.id_evento
    and id_bus = :old.id_bus;
      
    update bus_evento
    set disponible = v_disponible_old + 1, ocupado = v_ocupado_old - 1
    where id_evento = :old.id_evento
    and id_bus = :old.id_bus;

end; 
/
ALTER TRIGGER "JVM10"."TRG_DELETE_BUSINSCRIPCION" ENABLE;
--------------------------------------------------------
--  DDL for Trigger TRG_INSERT_BUSINSCRIPCION
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "JVM10"."TRG_INSERT_BUSINSCRIPCION" 
before insert on bus_inscripcion
for each row
declare

v_disponible number := 0;
v_ocupado number := 0;

begin
  
    select disponible, ocupado
    into v_disponible, v_ocupado
    from bus_evento
    where id_evento = :new.id_evento
    and id_bus = :new.id_bus;
    
    update bus_evento
    set disponible = v_disponible - 1, ocupado = v_ocupado + 1    
    where id_evento = :new.id_evento
    and id_bus = :new.id_bus;
    
end; 
/
ALTER TRIGGER "JVM10"."TRG_INSERT_BUSINSCRIPCION" ENABLE;
