--  DDL for Trigger TRG_REGISTRA_RECIBO
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "JVM10"."TRG_REGISTRA_RECIBO" 
before insert on movimientos 
for each row
declare

v_monto_total_evento number:=0;
v_monto_abonado number:=0;
v_monto_abonado_a number:=0;
v_saldo_pendiente number:=0;
v_correlativo_nota number:=0;

  BEGIN
  
      select sum(oe.precio) total_evento
      into v_monto_total_evento
      from inscripcion_opcion io, opcion_evento oe
      where io.id_evento = oe.id_evento
      and io.id_opcion = oe.id_opcion
      and io.estado_registro = 'A'
      and io.id_participante = :new.id_participante
      and io.id_evento = :new.id_evento;
      
      select total_abono-total_cargo abonado
      into v_monto_abonado_a
      from(      
      select nvl(sum(valor),0) total_abono
      from movimientos
      where tipo_mov = 'AB'
      and id_participante = :new.id_participante
      and id_evento = :new.id_evento) abono,      
      (
      select nvl(sum(valor),0) total_cargo
      from movimientos
      where tipo_mov = 'CR'
      and id_participante = :new.id_participante
      and id_evento = :new.id_evento) cargo;
    
    if :new.tipo_mov = 'AB' then
    
          v_monto_abonado := v_monto_abonado_a + :new.valor;
          
          v_saldo_pendiente := v_monto_total_evento - v_monto_abonado;
          
          begin
                                    :new.id_movimiento,
                                    :new.valor,
                                    v_monto_total_evento,
                                    v_monto_abonado,
                                    v_saldo_pendiente,
                                    sysdate);
          exception
          when others then
          raise_application_error(-20000, 'No fue posible ejecutar el insert en tabla recibo '||SQLCODE||' error '||sqlerrm);
          end;
          
          begin
          
          select :new.id_movimiento, io.id_opcion, oe.descripcion, oe.precio, sysdate
          from inscripcion_opcion io, opcion_evento oe
          where io.id_evento = oe.id_evento
          and io.id_opcion = oe.id_opcion
          and io.estado_registro = 'A'
          and io.id_participante = :new.id_participante
          and io.id_evento = :new.id_evento;
          
          exception
          when others then
          raise_application_error(-20000, 'No fue posible ejecutar el insert en tabla recibo_detalle '||SQLCODE||' error '||sqlerrm);
          end;
          
    elsif :new.tipo_mov = 'CR' then
            
          select correlativo_disponible
          into v_correlativo_nota
          from correlativo 
          where id_correlativo = 10 
          and estado_registro = 'A';
          
          begin  
                                        v_correlativo_nota,
                                        :new.id_movimiento,
                                        :new.valor,
                                        :new.descripcion,
                                        sysdate,
                                        :new.usuario_creacion,
                                        sysdate);
          exception
          when others then
          raise_application_error(-20000, 'No fue posible ejecutar el insert en tabla nota_credito '||SQLCODE||' error '||sqlerrm);
          end;
          
    end if;
end; 
/
ALTER TRIGGER "JVM10"."TRG_REGISTRA_RECIBO" ENABLE;
