--  DDL for Trigger TRG_UPDATE_BUSINSCRIPCION
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "JVM10"."TRG_UPDATE_BUSINSCRIPCION" 
before update of no_bus on bus_inscripcion
referencing new as new old as old
for each row
declare

v_disponible_old number :=0;
v_ocupado_old number:=0;
v_disponible_new number :=0;
v_ocupado_new number :=0;

begin

  select disponible, ocupado
  into v_disponible_old,v_ocupado_old
  from bus_evento
  where id_evento = :old.id_evento
  and id_bus = :old.id_bus;
  
  update bus_evento
  set disponible = v_disponible_old + 1, ocupado = v_ocupado_old - 1
  where id_evento = :old.id_evento
  and id_bus = :old.id_bus;
  
  select disponible, ocupado
  into v_disponible_new,v_ocupado_new
  from bus_evento
  where id_evento = :new.id_evento
  and id_bus = :new.id_bus;
  
  update bus_evento
  set disponible = v_disponible_new - 1, ocupado = v_ocupado_new + 1
  where id_evento = :new.id_evento
  and id_bus = :new.id_bus;

end; 
/
ALTER TRIGGER "JVM10"."TRG_UPDATE_BUSINSCRIPCION" ENABLE;
