--  DDL for Trigger TRG_UPDATE_INS_OPC
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "JVM10"."TRG_UPDATE_INS_OPC" 
before update of estado_registro on inscripcion_opcion
referencing new as new old as old
for each row
    WHEN (new.estado_registro = 'B') declare

v_valida_bus number:=0;

begin

    select count(*) bus_asignado
    into v_valida_bus
    from bus_inscripcion bi, opcion_evento oe
    where bi.id_evento = oe.id_evento
    and oe.es_transporte = 'S'
    and bi.id_evento = :old.id_evento
    and bi.id_participante = :old.id_participante
    and oe.id_opcion = :old.id_opcion;
    
    if v_valida_bus = 1 then
    
    delete from bus_inscripcion
    where id_evento = :old.id_evento
    and id_participante = :old.id_participante;
    
    end if;

end; 
/
ALTER TRIGGER "JVM10"."TRG_UPDATE_INS_OPC" ENABLE;
